 aria-hidden stroke-linejoin="round" version="1.1" height="24" width="24"><circle cx="12" cy="12" r="10"></circle><polygon points="10 8 16 12 10 16 10 8"></polygon></svg> Restore game</button></div><div class="iframe_placeholder" data-iframe="&lt;iframe src=&quot;https://v6p9d9t4.ssl.hwcdn.net/html/3602925-383830/index.html&quot; allow=&quot;autoplay; fullscreen *; geolocation; microphone; camera; midi; monetization; xr-spatial-tracking; gamepad; gyroscope; accelerometer; xr; cross-origin-isolated&quot; allowtransparency=&quot;true&quot; webkitallowfullscreen=&quot;true&quot; mozallowfullscreen=&quot;true&quot; msallowfullscreen=&quot;true&quot; frameborder=&quot;0&quot; allowfullscreen=&quot;true&quot; scrolling=&quot;no&quot; id=&quot;game_drop&quot;&gt;&lt;/iframe&gt;"><button class="button load_iframe_btn"><svg role="img" viewbox="0 0 24 24" fill="none" stroke-width="2" stroke="currentColor" stroke-linecap="round" class="svgicon icon_play" aria-hidden stroke-linejoin="round" version="1.1" height="24" width="24"><circle cx="12" cy="12" r="10"></circle><polygon points="10 8 16 12 10 16 10 8"></polygon></svg> Run game</button></div></div></div><div class="columns"><div class="left_col column"><div class="formatted_description user_formatted"><p><strong>Note:&nbsp;I recommend playing&nbsp;<a href="https://varunramesh.itch.io/feedvid-live">FeedVid Live</a>&nbsp;first before playing this game. The black screen video in this game&nbsp;is optional.</strong><br></p>  <p class="text-center">*****</p>  <p>FeedVid is a&nbsp;short puzzle game taking place in an unusual video-sharing app.</p>  <p>If you get stuck, please try the in-game hints menu. If that doesn&#x27;t help,&nbsp;here&#x27;s the answer key.</p>  <details>    <summary><strong>FeedVid v1.3 Puzzle Solutions</strong></summary>  <div>    <details>      <summary><strong>I need the first door code.</strong></summary>      <div>The titles of the videos spell out the code, which is 7395. Post this number as a comment on the video of the keypad.</div>    </details>    <details>      <summary><strong>I need directions for the vents.</strong></summary>      <div>If you take the BrickBlock secret code and extend it using the Cyber Warriors thumbnail, you get the answer: up right down right right up up left up up.</div>    </details>    <details>      <summary><strong>I need the second door code.</strong></summary>      <div>Like the &quot;ARNIE IS EVIL&quot; video. The uploader will then upload a second video with the comment &quot;Jumpscare at 12:03.&quot; The code is 1203.</div>    </details>  </div>  </details>  <p class="text-center">*****</p>  <h2>Backstory</h2>  <p>Introducing FeedVid, a revolutionary new video-sharing website and social network. Our platform integrates an advanced <strong>neural-network based algorithm</strong> that automatically determines your viewing preferences. We serve you the content that you want to watch!</p>  <h3>Update from FeedVid Inc. CEO August Williams</h3>  <p>We are aware of an issue affecting a small number of users in which our algorithm will recommend disturbing or highly unusual videos. We appreciate the support from the community and ask that you flag any such videos that you find in your feed.</p></div><div class="more_information_toggle"><div class="toggle_row"><a class="toggle_info_btn" href="javascript:void(0)">More information<svg width="12" class="svgicon icon_down_tick" role="img" height="6" version="1.1" viewbox="0 0 37 20" aria-hidden><path d="m2.0858 0c-1.1535 0-2.0858 0.86469-2.0858 1.9331 0 0.5139 0.21354 1.0183 0.38704 1.1881l18.113 16.879 18.112-16.879c0.174-0.1696 0.388-0.674 0.388-1.1879 0-1.0684-0.932-1.9331-2.086-1.9331-0.577 0-1.111 0.23008-1.49 0.57992l-14.924 13.894-14.925-13.893c-0.3777-0.34998-0.9134-0.581-1.4902-0.581z"/></svg></a></div><div class="info_panel_wrapper"><div id="game_info_panel_9051651" class="game_info_panel_widget base_widget"><table><tbody><tr><td>Status</td><td><a href="https://itch.io/games/rel